-- -----------------------------------------------------
-- Table  `Account`
-- -----------------------------------------------------



CREATE TABLE IF NOT EXISTS `Account` (  
 `account_Id` INT UNSIGNED NOT NULL AUTO_INCREMENT,
  `account_name` VARCHAR(45) NOT NULL,
  `email` VARCHAR(45) NULL,
  `additional_info` VARCHAR(450) NULL,
  `password` VARCHAR(128)  NULL,
  `creation_date` VARCHAR(45) NULL,
  PRIMARY KEY (`account_Id`),
  UNIQUE INDEX `userID_UNIQUE` (`account_Id` ASC),
  UNIQUE INDEX `email_UNIQUE` (`email` ASC)
);




-- -----------------------------------------------------
-- Table  `Data_Set`
-- -----------------------------------------------------



CREATE TABLE IF NOT EXISTS `Data_Set` (
  `data_set_id` INT UNSIGNED NOT NULL,
  `account_fk_id` INT UNSIGNED NOT NULL,
  `data_set_name` VARCHAR(145) NOT NULL,
  `data_set_description` VARCHAR(545) NULL,
  `market_data_frequency` INT NOT NULL,
  `data_providers` VARCHAR(155) NULL,
  PRIMARY KEY (`data_set_id`, `account_fk_id`),
  UNIQUE KEY `data-set-id_UNIQUE` (`data_set_id` ASC)
  );
  CREATE INDEX `fk_data-Set_Account1_idx` on `Data_Set`(`account_fk_id` ASC);
  ALTER TABLE `Data_Set` ADD CONSTRAINT `fk_data-Set_Account1` FOREIGN KEY (`account_fk_id`)
       REFERENCES `Account` (`account_Id`)
       ON DELETE CASCADE
       ON UPDATE CASCADE;


