-- -----------------------------------------------------
-- Table  `Strategy_Folder`
-- -----------------------------------------------------


CREATE TABLE IF NOT EXISTS `Strategy_Folder` (
  `folder_id` INT UNSIGNED NOT NULL AUTO_INCREMENT,
  `account_fk_Id` INT UNSIGNED NOT NULL,
  `folder_name` VARCHAR(45) NULL,
  `folder_description` VARCHAR(500) NULL,
  PRIMARY KEY (`folder_id`, `account_fk_Id`)
    );
  CREATE INDEX `idFolder_UNIQUE` on Strategy_Folder (`folder_id` ASC);
  CREATE INDEX `folder_name_UNIQUE` on Strategy_Folder (`folder_name` ASC);
  CREATE INDEX `fk_Strategy_Folder_Account1_idx` on Strategy_Folder (`account_fk_Id` ASC);
  ALTER TABLE Strategy_Folder ADD CONSTRAINT `fk_Strategy_Folder_Account1`
        FOREIGN KEY (`account_fk_Id`)
        REFERENCES `Account` (`account_Id`)
        ON DELETE CASCADE
        ON UPDATE CASCADE;

