-- -----------------------------------------------------
-- Table  `Strategy`
-- -----------------------------------------------------

CREATE TABLE IF NOT EXISTS `Strategy` (
  `strategy_id` INT UNSIGNED NOT NULL AUTO_INCREMENT,
  `strategy_name` VARCHAR(245) NOT NULL,
  `author` VARCHAR(245) NOT NULL,
  `creation_date` DATETIME(1) NOT NULL,
  `modified` TIMESTAMP(1) NOT NULL,
  `fk_folder_id` INT UNSIGNED NOT NULL,
  `fk_account_fk_Id` INT UNSIGNED NOT NULL,
  `filepath` VARCHAR(1145) NOT NULL,
  PRIMARY KEY (`strategy_id`, `fk_folder_id`, `fk_account_fk_Id`),
  UNIQUE KEY `strategy_id_UNIQUE` (`strategy_id` ASC)
  );
 CREATE INDEX  `fk_Strategy_Strategy_Folder1_idx` on Strategy (`fk_folder_id` ASC,
 `fk_account_fk_Id` ASC);
  ALTER TABLE `Strategy` ADD  CONSTRAINT `fk_Strategy_Folder`
      FOREIGN KEY (`fk_folder_id` , `fk_account_fk_Id`)
      REFERENCES `Strategy_Folder` (`folder_id` , `account_fk_Id`)
      ON DELETE CASCADE
      ON UPDATE CASCADE;




