CREATE TABLE IF NOT EXISTS `Market_Data` (
  `md_id` INT  NOT NULL AUTO_INCREMENT,
  `data_set_fk_id` INT UNSIGNED NOT NULL,
  `instId` VARCHAR(20)  NOT NULL,
--  `ticker` VARCHAR(15)  NOT NULL,
  `ticker` VARCHAR(15)  NULL,
  `date` TIMESTAMP NOT NULL,
  `open` FLOAT NOT NULL,
  `high` FLOAT NOT NULL,
  `low` FLOAT NOT NULL,
  `close` FLOAT NOT NULL,
  `vol` INT NOT NULL,
  `additional_info` VARCHAR(545) NULL DEFAULT 'n/a',
  PRIMARY KEY (`md_id`, `instId`, `data_set_fk_id`)
 );

CREATE INDEX `fk_Market-Data_data-Set1_idx`
  on `Market_Data` (`data_set_fk_id` ASC, `ticker` ASC, `instId` ASC);
  ALTER TABLE `Market_Data` ADD CONSTRAINT `fk_data-Set`
     FOREIGN KEY (`data_set_fk_id`)
     REFERENCES  `Data_Set` (`data_set_id`)
     ON DELETE CASCADE
     ON UPDATE CASCADE;


